-- ElvUI Profile Strings
-- ElvUI has 3 separate export types that all need to be imported:
-- 1. Profile (db.profiles) - Main profile settings
-- 2. Global (db.global) - Account-wide settings
-- 3. Private (db.private) - Installation/private settings

local E = unpack(ElvUI)
if not E then return end

ElvUI_NornEdit_Profiles = ElvUI_NornEdit_Profiles or {}

-- === HOW TO GENERATE THESE STRINGS ===
-- 
-- 1. PROFILE STRING (Main Settings):
--    - Go to /elvui -> Profiles tab
--    - Click "Export Profile"
--    - Copy the string (starts with !E1!)
--    - Paste below in ElvUI_Profile
--
-- 2. GLOBAL STRING (Account-Wide Settings):
--    - Go to /elvui -> Profiles tab
--    - Click "Export Global"  
--    - Copy the string (starts with !E1!)
--    - Paste below in ElvUI_Global
--
-- 3. PRIVATE STRING (Private/Install Settings):
--    - Go to /elvui -> Profiles tab
--    - Click "Export Private"
--    - Copy the string (starts with !E1!)
--    - Paste below in ElvUI_Private
--
-- All 3 strings are important for a complete profile!

